    false,nt"url": null,nt"notes": "From 2007 to 2009, a total of eight moorings
    were deployed, including A1W, A1, and A1E in the Russian channel of the Strait,
    A2W, A2, A4W (A4W for 2007 to 2008 and A4R for 2008 to 2009), A4 in the US channel
    of the strait, and A3 at a site just north of the strait. Moorings carry a variety
    of instruments: ADCP, Temperature Salinity Pressure recorder (with optical data),
    Pressure Gauge, acoustic current meter with turbidity sensor, and lightweight acoustic
    current meter. These data were collected by the University of Washington Applied
    Physics Laboratory personnel as part of the Russian-American Long-term Census of
    the Arctic project (RUSALCA).",nt"license_title": null,nt"extras": [{ntt"key":
